import React from 'react';
import FormContainer from './FormContainer/FormContainer';

import Classes from './App.css';

import './App.css';

function App() {
  return (
    <div className={Classes.App}>
    <h1>React Form</h1>
    <FormContainer />
  </div>
  );
}

export default App;
